import React, {Component} from 'react';
import SearchBox from './SearchBox';
import CardList from './CardList';
import {robots} from './robots.js'

const state = {
  robots: robots,
  searchfield: ''
}

class App extends Component {
  render() {
    return (
      <div className='tc'>
       <h1>Robobook</h1>
       <SearchBox />
       <CardList robots = { robots }/>
      </div>
    );
  }
}

export default App;
